import React from 'react';
import classes from './Salad.module.css';


const Salad = (props) => {
    return (
        <div className={classes.Salad}>

            <img className={classes.Plate} src="plate.jpg" alt='saladPlate'/>
        </div>
    );
}

export default Salad;
